import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.dash = {
      name: 'akash',
      middle: 'kumar',
      last: 'kumar',
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <button
            onClick={() => {
              this.dash.name = 'Krithha';
              console.log(this.dash.name);
            }}
          >
            Change Name
          </button>
          <p>Hi {this.dash.name.toUpperCase()}</p>
          {/* <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a> */}
        </header>
      </div>
    );
  }
}

export default App;
